import './App.css';
import { BrowserRouter, Route, Routes } from 'react-router-dom';
import Services from './service';
import Gallery from './gellary';
import AboutPage from './AboutPage';
import Form from './Form';
import ContactSection from './contact';
// import Navbar from "./Navbar"
import NavBarHarsh from './NavBarHarsh';
import Footer from './Footer';
import AllPages from './AllPages';

function App() {
  return (
<>
{/* <div className="content"> */}
        <BrowserRouter>
       {/* <AllPages></AllPages> */}
        <Routes>
          <Route path='/' element={<AllPages />}></Route>
          {/* <Route path="/" element={
            <div>
              <div className="hero-text"></div>
              <div className="hero-image"></div>
            </div>
          } /> */}
          <Route path="/services" element={<Services />} />
          <Route path="/src/Pages/AboutPage.js" element={<AboutPage/>} />
          <Route path="/gallery" element={<Gallery />} />
          <Route path="/contact" element={<ContactSection />} />
          <Route path="/privacy" element={<div>Privacy & Policy</div>} />
          <Route path="/form/:type" element={<Form />} /> {/* Dynamic route for login/signup */}
        </Routes>

        </BrowserRouter>
      {/* </div> */}

</>
  );
}

export default App;
